function [c,s] = GR(x,y)
    if(abs(x) >= abs(y))
        r = x/y;
        s = 1/sqrt(1+r*r);
        c = s*r;
    else
        r = y/x;
        c = 1/sqrt(1+r*r);
        s = c*r;
    end
end

