                R(k,i) = (c * a(i)) + (s * b(i));
            end
            
            for i = k : 1 : column_size
                R(j,i) = (c * b(i)) - (s * a(i));
            end

%             for i = 1 : 1 : row_size
%                 a(i) = Q(i,k);
%             end
            a = Q(:,k);

%             for i = 1 : 1 : row_size
%                 b(i) = Q(i,j);
%             end
            b = Q(:,j);

%             for i = 1 : 1 : row_size
%                 Q(i,k) = (c * a(i)) + (s * b(i));
%             end
            Q(:,k) = c*a + s*b;

%             for i = 1 : 1 : row_size
%                 Q(i,j) = (c * b(i)) - (s * a(i));
%             end
            Q(:,j) = c*b - s*a;
        end
    end
end

